import React from 'react';
import { Container, Typography, Box, Grid } from '@mui/material';
import SetMealIcon from '@mui/icons-material/SetMeal'; // Replace with relevant icon

function InfoSection({ title, content, id }) {
  return (
    <Container maxWidth="md" id={id} sx={{ paddingY: 5 }}>
      <Box sx={{ textAlign: 'center', marginBottom: 4 }}>
        <Typography variant="h4" gutterBottom sx={{ color: '#102539', fontWeight: 'bold' }}>
          {title}
        </Typography>
        <Grid container justifyContent="center" sx={{ marginBottom: 4 }}>
          <SetMealIcon fontSize="large" sx={{ color: '#00522D' }} />
        </Grid>
        <Typography variant="body1" color="textSecondary" sx={{ fontSize: '1.1rem' }}>
          {content}
        </Typography>
      </Box>
    </Container>
  );
}

export default InfoSection;
